import React from "react";

function About() {
  return (
    <div>
    <div className="section">
      <h1>About</h1>
    </div>
    <div class="section-content">
          <p>
            This is a budget tracker app that can give you an overview and
            charts of your income, expenses, as well as your savings. This app
            will help you to track your money by showing your transaction
            history. This app was built using HTML, CSS, JavaScript and React.js
            for the front-end, and utilized Mongoose, Node.js, and MongoDB for
            the back-end.
          </p>
          </div>
          /</div>

  );
}

export default About;
